        SpinePlay(mainPlayer, null, null, AniShip.fire, 7, false, SPINE_INIT_ALL);
        SESoundPlay(se.RockShoot); //운석발사음
        sendidx3 = (sendactidx) % BSfinaleCount; //0,1,2,반복 //총알스프라이트 인덱스

