function debug_GridAttr() {
    var s = "";
    for (var j = 0; j < level.rows; j++) {
        for (var i = 0; i < level.columns; i++) {
            var tile = level.tiles[i][j]; //레벨1속의 공1 가져온다.
            if (tile.type == -1) {
                s += "-, ";
            } else {
                s += (tile.type + ", ");
            }
        }
        s += "\n";
    }
    if(dm) console.log(s);
}
